<div class="entities" style="line-height: 2.5; direction: ltr">Purification and characterization of a high molecular weight histone deacetylase complex ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) of maize embryos . The dynamic state of core histone acetylation is maintained by histone acetyltransferases and deacetylases . In germinating maize embryos , four nuclear histone deacetylases can be distinguished . From a chromatin fraction prepared at 72 h after start of embryo germination , we have purified the nuclear histone deacetylase 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q92769
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 to homogeneity . Using a sequence of chromatographic steps , we achieved the purification of an enzymatically active high molecular weight protein complex with an apparent molecular mass of 400 kDa , as determined by gel filtration chromatography . The purified enzyme was characterized in terms of enzymatic and kinetic properties , and sensitivity to several histone deacetylase inhibitors . In SDS-polyacrylamide gels , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q92769
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 split into three polypeptides of 45 , 42 , and 39 kDa , suggesting that the native enzyme is a multimer-protein complex . Electrophoresis under nondenaturing conditions in combination with second dimension SDS-gel electrophoresis indicated that all three protein components of the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q92769
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 complex were enzymatically active . Polyclonal antibodies against each of the three polypeptides were raised in rabbits . Each antiserum reacted with all three polypeptides on Western blots , suggesting that 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P29466

 , Q8NFH3 , and p39 are highly homologous . This homology was confirmed by amino acid sequencing of peptides generated from each of the three

 components .</div>

<h2 style="margin: 0">1</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB06288
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 is a potent 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P34969
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 antagonist : relevance for antidepressant actions in vivo . RATIONALE : 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB06288
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 is approved for clinical use in treating schizophrenia in a number of European countries and also for treating dysthymia , a mild form of depression , in Italy . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB06288
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 has also been demonstrated to be an antidepressant for patients with major depression in many clinical trials . In part because of the selective D ( 2 ) / D ( 3 ) receptor antagonist properties of amisulpride , it has long been widely assumed that dopaminergic modulation is the proximal event responsible for mediating its antidepressant and antipsychotic properties . OBJECTIVES : The purpose of these studies was to determine if amisulpride ' s antidepressant actions are mediated by off-target interactions with other receptors . MATERIALS AND METHODS : We performed experiments that : ( 1 ) examined the pharmacological profile of amisulpride at a large number of central nervous system ( CNS ) molecular targets and , ( 2 ) after finding high potency antagonist affinity for human 5 - HT ( 7a ) serotonin receptors , characterized the actions of amisulpride as an antidepressant in wild-type and 5 - HT ( 7 ) receptor knockout mice . RESULTS : We discovered that amisulpride was a potent competitive antagonist at 5 - HT ( 7a ) receptors and that interactions with no other molecular target investigated in this paper could explain its antidepressant actions in vivo . Significantly , and in contrast to their wild-type littermates , 5 - HT ( 7 ) receptor knockout mice did not respond to amisulpride in two widely used rodent models of depression , the tail suspension test and the forced swim test . CONCLUSIONS : These results indicate that 5 - HT ( 7a ) receptor antagonism , and not D ( 2 ) / D ( 3 ) receptor antagonism , likely underlies the antidepressant actions of amisulpride .</div>

<h2 style="margin: 0">5</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Clot penetration and retention by plasminogen activators promote fibrinolysis . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00750
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ( tPA ) remains the sole thrombolytic approved by the FDA for the treatment of pulmonary embolism ( PE ) . tPA has not been replaced by third generation plasminogen activators , e . g . DB00015 ( Ret ) and 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00031
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 ( TNK ) that circulate with longer life-spans and in theory should have more extended potency in vivo . One reason for this paradox is the inability to assign units of activity to plasminogen activators based on specific biologically relevant standards , which impairs objective comparison . Here , we compare clot permeation , retention and fibrinolytic activities of tPA , TNK and Ret in vitro and clot composition over time with outcome in a mouse model of disseminated pulmonary microembolism ( ME ) . When clots were incubated in the continuous presence of drug , tPA , TNK and Ret lysed fibrin clots identically in the absence of PA inhibitor - 1 ( e . g . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P05121
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) . Ret , which has lower fibrin affinity and greater susceptibility to inhibition by 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P05121
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 than tPA , was less effective in lysing plasma clots , while TNK was less effective when the fibrin content of the clots was enhanced . However , when clots were afforded only brief exposure to drug , as occurs in vivo , Ret showed more extensive clot permeation , greater retention and lysis than tPA or TNK . These results were reproduced in vivo in a mouse model of ME . These studies indicate the need for more relevant tests of plasminogen activator activity in vitro and in vivo and they show that clot permeation and retention are important potential predictors of clinical utility .</div>

 in the management of functional dyspepsia and delayed gastric emptying ] .

 is a sulpiride isomer that exerts its prokinetic action through a dual mechanism : 1 ) as a

<h2 style="margin: 0">15</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">

</mark>
 subunit of DB01221 receptor and inhibits DB01221 response in neuronal cells . We found that DB01221 receptor was co-immunoprecipitated by anti-Ras antibody and this complex , beside NR2 subunit of DB01221 receptor contained haloperidol-binding proteins , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 and Ras - 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01286
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 . Furthermore , we have shown that haloperidol induces neurotoxicity of neuronal cells via DB01221 receptor complex , accompanied by dissociation of Ras - 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01286
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 from membranes and activation of c-Jun-kinase . Inclusion of insulin prevented relocalization of Ras -

 and subsequent neuronal death . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #CC9966); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00502
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MENMAX</span>
</mark>

<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00502

 - induced dissociation of Ras - 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 leads to inhibition of membrane-bound form of Ras protein and changes downstream regulators activity that results in the initiation of the apoptotic processes via the mitochondrial way . Our results suggest that haloperidol induces neuronal cell death by the interaction with DB01221 receptor , but through the alternative from glutamate excitotoxicity signaling pathway .</div>
